import './App.css';
import Header from './components/header.js'
import { TransactionProvider } from './components/transContext';
import AddTransaction from './addTrans.js';
import { TransactionHistory } from './transHistory';
import Expense from './expense.js';


function App() {
  return (

    <TransactionProvider>
      <dic className='header'>
      <Header />
      <Expense />
      <TransactionHistory />
      <AddTransaction />
      </dic>


      </TransactionProvider>

  );
}

export default App;
